import React from "react";

const FolderForms = ({ folder, openDeleteFormModal }) => {
  return (
    <ul className="form-list">
      {folder.forms.length === 0 ? (
        <li>No forms in this folder.</li>
      ) : (
        folder.forms.map((form, idx) => (
          <div key={idx} className="form-item">
            <span>{form}</span>
            <button
              className="delete-button-form"
              onClick={() => openDeleteFormModal(idx)}
            >
              <img src="del.png" className="del-form" alt="Delete" />
            </button>
          </div>
        ))
      )}
    </ul>
  );
};

export default FolderForms;
